function energySettings() {
MODEL=$(sysctl -n hw.model | grep "mini")

if [[ "$MODEL" = "" ]]; then
	echo "setting energy settings"
	pdisplay=$(pmset -g | grep displaysleep | awk '{print $2}')
	
    if [[ $pdisplay -le 10 ]]; then
     pmset -a displaysleep 20
    fi
fi

}



# Start
echo "Build: $BUILD"

echo "Extracting Screen Saver"
extractScreenSaver
energySettings


if [ ! -d "$SS_PATH" ]; then
    echo "Unable to find \"${SS_PATH}\", aborting"
    exit 1
fi

if [ "$MODULE" = "" ]; then
	echo "unable to find a module for the screensaver, aborting"
	exit 2
fi 

echo "Checking if System Preferences is running"
SYS_PREFS=`ps aux | grep -i "[S]ystem Preferences.app" | awk '{print $2}'`
for SYS_PREFS_PID in $SYS_PREFS; do
    echo "Killing System Preferences - $SYS_PREFS_PID"
    kill -9 $SYS_PREFS_PID > /dev/null 2>&1
done

echo "Getting list of users"
USERS=`dscl /Local/Default -list /Users | grep -v "^_" | grep -iwv "daemon" | grep -iwv "nobody" | grep -iwv "^root"`


if [[ "$OS_MAJOR" -eq 11 ]] || [[ "$OS_MAJOR" -eq 10 && "$OS_MINOR" -ge 15 ]]; then
for currUser in $USERS; do
sudo su - "$currUser" << EOF
defaults -currentHost write com.apple.ScreenSaverPhotoChooser  "CustomFolderDict" -dict-add "identifier" "/Users/Shared/.ScreenSaver" "name" "ScreenSaver"
EOF
done
fi

for currUser in $USERS; do
    echo "Applying Screen Saver to the user \"${currUser}\""
    su - "$currUser" -l << EOF
defaults -currentHost write com.apple.screensaver CleanExit -string "YES"
defaults -currentHost write com.apple.screensaver PrefsVersion -int 100
defaults -currentHost write com.apple.screensaver showClock -string "NO"
defaults -currentHost write com.apple.screensaver idleTime -int 600
defaults -currentHost write com.apple.screensaver moduleDict -dict moduleName -string "iLifeSlideshows" path -string "$MODULE" type -int 0
defaults -currentHost write com.apple.screensaver tokenRemovalAction -int 0
defaults -currentHost write com.apple.ScreenSaverPhotoChooser LastViewedPhotoPath -string ""
defaults -currentHost write com.apple.ScreenSaverPhotoChooser SelectedFolderPath -string "${SS_PATH}/"
defaults -currentHost write com.apple.ScreenSaverPhotoChooser SelectedSource -int 4
defaults -currentHost write com.apple.ScreenSaver.iLifeSlideShows styleKey -string "KenBurns"
rm ~/Library/LaunchAgents/com.sn.screensaver.Launchd.plist > /dev/null 2>&1
killall -hup cfprefsd
EOF
done


echo "Done"
exit 0 